    // Correct! There is no need to specify the key here:
    return this.state.data.map(val => (
      <div className="station" key={val}>
        {val}
      </div>
    ));
  }

  render() {
    return (
      <div>
        <ul>
          {this.state.data.map(function(item, i) {
            <li>Test</li>;
          })}
